.Header
{
    background-color: transparent;
    position: relative;
    padding: 0;
    top:0;
    left:0;
    width: 100vw;
    height: 80px;
    .items
    {
        display: flex;
        align-items: center;
        li
        {
            list-style: none;
            margin-right: 1rem;
            position: relative;
            z-index: 1;
            &:last-of-type
            {
                margin-right: 0;
            }
            .nav-item-link
            {
                font-size: .75rem;
                font-weight: 700 ;
                color: $secondary-color-dark ;
                text-transform: uppercase;
                transition: all 500ms ease-in-out;
            }
            .nav-item-link.active
            {
                color: $primary-color;
            }
        }
        li::after
        {
            content:'';
            position: absolute;
            width: 0;
            height: 2px;
            background-color: $primary-color;
            z-index: 1;
            top: 50%;
            right: 0;
            transform: translateX(-8px);
            opacity: 0;
            transition:opacity,width 500ms ease-in-out
        }
        li:nth-of-type(2n)::after
        {
            display: none;
        }
        li:hover::after, li.active::after
        {
            opacity: 1;
            width: 100%;
        }
        li:hover .nav-item-link
        {
            color: $primary-color;
        }
    }
    .SeacrhBtn
    {
        button
        {
            border: none;
            background-color: transparent;
            outline: none;
            margin-left:5rem;
            i
            {
                color: $secondary-color-dark;
                font-weight: 600;
            }
        }
    }
}
